import React, { Component } from 'react';



class Footer extends Component {

	render(){
		return(

			<div style={{backgroundColor:'rgb(20,20,20)', padding:'16px', display:'flex', alignItems:'center', justifyContent:'space-between'}}>
				<div>
					<span className='white'>Women Men Kids Shoes Brands</span>
				</div>
				<div>
					<span className='gray'>2016 Shopmate Ltd - Contact - Privacy Policy</span>
				</div>
			</div>
		);
	}
}


export default Footer;
